import React, {Component} from 'react';

class form extends Component {
  constructor(props) {
    super();
    this.question = props.question;
  }

render() {
  return (
    <form id="survey-form">
          <h1> {this.question} </h1>

        <label>
          <input name="user-recommend" type="radio" class="input-radio"/>Music</label>
        <label>
          <input name="user-recommend" type="radio" class="input-radio" />Acting</label>
        <label><input name="user-recommend" type="radio" class="input-radio" />Story</label>
        <label><input name="user-recommend" type="radio" class="input-radio" />Actors</label>

         <button type="submit" id="submit" class="submit-button">
          Submit
        </button>

     </form>
);
}
}

export default form;
